  true,\n\t\"url\": null,\n\t\"notes\": \"<p>There are two methods for a hospital
  to qualify for the Medicare DSH adjustment. The primary method is for a hospital
  to qualify based on a statutory formula that results in the DSH patient percentage.
  The DSH patient percentage is equal to the sum of the percentage of Medicare inpatient
  days attributable to patients eligible for both Medicare Part A and Supplemental
  Security Income (SSI), and the percentage of total inpatient days attributable to
  patients eligible for Medicaid by not Medicare Part A.</p>n\",\n\t\"license_title\":
